import { Github } from "react-bootstrap-icons";
import { Linkedin } from "react-bootstrap-icons";
import { Instagram } from "react-bootstrap-icons";

export const Footer = () => {
    return (
        <div className="footer">
            <button className="socials" id="github"><Github size={60} /></button>
            <button className="socials" id="linkedin"> <Linkedin size={60} /></button>
            <button className="socials" id="instagram"> <Instagram size={60} /></button>
        </div>
    );
}

export default Footer;
